import './jobs.styles.css'
const Jobs = () => {
    console.log(JobsData)
    const jobs = JobsData['jobs']
    return(
        <div className='jobs'>
        {
          Object.keys(jobs).map(job =>{
            const {title,batch,salary,link} = jobs[job]
          })
        }
       </div>
    )
}

